<script>
    $(document).ready(function () {
        $('#311CallsTable').after('<div id=""nav""></div>');
        var rowsShown = 20;
        var rowsTotal = $('#data tbody tr').length;
        var numPages = rowsTotal / rowsShown;
        for (i = 0; i < numPages; i++) {
            var pageNum = i + 1;
            $('#nav').append('<a href=""#"" rel=""' + i + '"">' + pageNum + '</a> ');
        }
        $('#311CallsTable tbody tr').hide();
        $('#311CallsTable tbody tr').slice(0, rowsShown).show();
        $('#nav a:first').addClass('active');
        $('#nav a').bind('click', function () {

            $('#nav a').removeClass('active');
            $(this).addClass('active');
            var currPage = $(this).attr('rel');
            var startItem = currPage * rowsShown;
            var endItem = startItem + rowsShown;
            $('#311CallsTable tbody tr').css('opacity', '0.0').hide().slice(startItem, endItem).
                css('display'");
            WriteLiteral(", \'table-row\').animate({ opacity: 1 }, 300);\r\n        });\r\n    });\r\n</script>");
